 $(function(){
 	$(".global-select-div select").on("change",function(){
 		var elem = $(this);
 		elem.prev().html(elem.find("option:selected").text());
 	});
 	$(".global-video-link").magnificPopup({
 		type: 'iframe',
 		mainClass: 'mfp-fade',
 		removalDelay: 160,
 		preloader: false,
 		iframe:{
 			patterns:{
 				youtube: {
 					index: 'youtube.com/',
 					id: 'v=', 
 					src: '//www.youtube.com/embed/%id%?autoplay=1&rel=0' 
 				},
 				vimeo: {
 					index: 'vimeo.com/',
 					id: '/',
 					src: '//player.vimeo.com/video/%id%?autoplay=1'
 				},
 				youtubeshort: {
 					index: 'youtu.be/', 

 					id: function(url) { 
 						var slashPos = url.lastIndexOf('/'),
 						vidId = url.substr(slashPos);

 						return vidId; 
 					},

 					src: '//www.youtube.com/embed/%id%?autoplay=1&rel=0'
 				}
 			}
 		},
 		fixedContentPos: false
 	});
 });